class Solution:
	# @return a boolean

	#time limit exceded
	def checkInclusion1(self, s1, s2):
		i = 0
		l = len(s1)
		while(i < len(s2)):
			if(sorted(s1) == sorted(s2[i:i+l])):
				return True
			i+=1
		return False
	def dict_map(self, s):
		smap = {}
		i=0
		while(i < len(s)):
			if(s[i] not in smap):
				smap[s[i]]=1
			else:
				smap[s[i]]+=1
			i+=1
		return smap
	def checkInclusion2(self, s1, s2):
		i = 0
		l = len(s1)
		if(l > len(s2)):
			return False
		s1_map = self.dict_map(s1)
		print(s1_map)
		while(i<=(len(s2) - l)):
			s2_map = self.dict_map(s2[i:i+l])
			if(s1_map == s2_map):
				return True
			i+=1
		return False

	def list_map(self, s):
		smap = [0] * 26
		i=0
		while(i < len(s)):
			smap[ord('a') - ord(s[i])]+=1
			i+=1
		return smap

	def checkInclusion3(self, s1, s2):
		i = 0
		l = len(s1)
		if(l > len(s2)):
			return False
		s1_list = self.list_map(s1)
		while(i <= (len(s2) - l)):
			s2_list = self.list_map(s2[i:i+l])
			if(s1_list == s2_list):
				return True
			i+=1
		return False
	#using sliding window
	def list_map(self, s1, s2):
		smap1 = [0] * 26
		smap2 = [0] * 26
		i=0
		while(i < len(s1)):
			smap1[ord(s1[i]) - ord('a') ]+=1
			#print(ord(s1[i]))
			smap2[ord(s2[i]) - ord('a')]+=1
			i+=1
		return smap1, smap2
	def checkInclusion(self, s1, s2):
		i = 0
		l = len(s1)
		if(l > len(s2)):
			return False
		s1_list, s2_list = self.list_map(s1, s2)
		while(i < (len(s2) - l) ):
			if(s1_list == s2_list):
				return True
			s2_list[ord(s2[i+l:i+l+1]) - ord('a')] +=1
			s2_list[ord(s2[i:i+1]) - ord('a')] -=1
			i+=1
		if(s1_list == s2_list):
				return True
		return False


